import {request} from "./request";

export function salerLogin(data) {
    return request({
        url: '/salerLogin',
        method: 'post',
        data
    })
}

export function getSalerById_forSaler(id) {
    return request({
        url: `/saler/saler_id/${id}`,
        method: 'post',
        data
    })
}
